import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';

export default function App() {
  const app = css`
    box-sizing: content-box;
    padding: 0;
    margin: 0;
  `;

  const main = css`
    min-height: 100vh;
    padding: 0 0.5rem;
    align-items: center;
    margin-top: 5%;
    width: 50%;
    justify-content: center;
  `;

  const header = css`
    width: 100%;
    background-color: #4abdac;
  `;
  const img = css`
    width: 500px;
    margin-left: auto;
    margin-right: auto;
    display: block;
    padding-top: 50px;
    padding-bottom: 50px;
    margin-top: 30px;
  `;

  const quote = css`
    text-align: center;
    font-size: 1.5rem;
    font-family: 'Karla', sans-serif;
    margin-top: 60px;
    color: #555555;
  `;

  return (
    <div>
      <style>
        @import
        url('https://fonts.googleapis.com/css2?family=Karla:wght@400;700&display=swap');
      </style>
      <div css={app}>
        <Header />
        <div css={main}>
          <div css={header}>
            <img src="/wien.png" alt="vienna city" css={img} />
          </div>
          <div>
            <p css={quote}>
              Get your personalized plan based on your interests!
            </p>
          </div>
        </div>
        <Footer />
      </div>
    </div>
  );
}
